  return (
    <div className="Title">
      <header>
        <h1>Mood Chart</h1>
        <div className="Title-Subtitle">How do you feel today?</div>          


    <NavLink className="nav-link" to="/">List</NavLink>
    <NavLink className="nav-link" to="/about">About</NavLink>
    </header>
  </div>
  )
}

export default Title
